import { Route, Switch, useContext } from 'react-router-dom';

import Login from './auth/login/Login';
import Register from './auth/register/Register';
import { AuthContextProvider } from './auth/store/auth-context';
import Navigation from './menu/Navigation';
import AuthContext from './auth/store/auth-context';

const App = () => {
  return (
    <AuthContextProvider>
      <Navigation />
      <Switch>
        <Route path='/login'>
          <Login />
        </Route>
        <Route path='/register'>
          <Register />
        </Route>
        <Route path='*'>
          <Login />
        </Route>
      </Switch>
    </AuthContextProvider>
  );
};

export default App;
